import axios from "axios";

const API_URL = 'http://localhost:3000/restaurants';

export const productsService = {
    async getProducts(restaurantId) {
        const response = await axios.get(`${API_URL}/${restaurantId}`);
        return response.data.products; // Accedemos a los productos del restaurante
    }
};
